import './App.css';
import Thunderbutton from './components/Thunderbutton/Thunderbutton';
import Instructions from './components/Instructions/Instructions'
import 'tachyons';

class App extends Component {
  render() {
    return (
      <div className='App'>
      	<Instructions />
        <Thunderbutton />
      </div>
    );
  }
}

export default App;
